import React from 'react';
import styled from 'styled-components';

const Search = ({onSearch}) => {

    const getID = (id) => {
        onSearch(id);
    }

    return (
        <Form onSubmit={getID}>
            <input type="text" placeholder = "GitHub ID를 입력하세요."/>
        </Form>
    );
};

const Form = styled.div`
    input{
        margin-bottom:10px;
    }
`

export default Search;
